import React from "react";
import "./body.css";

function body() {
  return (
    <div id="thread-border">
      <div id="img-container">
        <img
          src="https://www.rollingstone.com/wp-content/uploads/2018/06/rs-12335-drake-624-1377173952.jpg?w=624"
          alt=""
          id="thread-img"
        />
      </div>
      <div id="thread-container">
        <p id="thread-text">My favorite album out right now</p>
        <label id="user"> -Jeff Mcmane</label>
      </div>
    </div>
  );
}

export default body;
